import React, { useState, useEffect } from 'react';
import { Checkbox } from 'pretty-checkbox-react';
//import styles from './Navigationbar.module.css';
import './Map.css'; // Import your CSS file for styling


const MapPage = () => {
    const [formData, setFormData] = useState({
        Physicalactivity: false,
        Alcohol: false,
        Cholesterol: false,
        // Add other form data states as needed
    });

    const handleChange = (e) => {
        let updatedValue;

        if (e.target.type === 'checkbox') {
            // Handle checkbox input
            if (
                [
                    'Physicalactivity',
                    'Smoking',
                    'Alcohol',
                    'VeggieFruit',
                    'Stress',
                    'Pressure',
                    'Sugar',
                    'Cholesterol',
                ].includes(e.target.name)
            ) {
                // Handle checkboxes
                if(e.target.value == true){
                    updatedValue = false;
                }else{
                    updatedValue = true;
                }

                setFormData({
                    ...formData,
                    [e.target.name]: updatedValue,
                });

            }
            // Add similar conditions for other checkboxes
        } else {
            // Handle other input types
            updatedValue = e.target.value;
            setFormData({
                ...formData,
                [e.target.name]: updatedValue,
            });
        }

        console.log('Aktualni hodnota pole ' + e.target.name + ' je: ' + updatedValue);
    };

    useEffect(() => {
        // Fetch data from the endpoint and filter based on formData values
        // Add your data fetching logic here
    }, [formData]);

    return (
        <div className="map-page">
            <div className="tip-section">
                <p className="tip-text">
                    <strong>TIP:</strong> Rizikové faktory je možno vybírat pouze tři najednou. Pro odebrání rizikového faktoru
                    odškrtněte daný rizikový faktor. Doporučujeme si pro výběr vybrat pro Vás nejdůležitější první
                    faktor a následně dle možnosti vyzkoušet a kombinovat dostupné další rizikové faktory. Výsledky
                    se zobrazují graficky na mapě v dolní části stránky.
                </p>
                <button className="detail-button">Zobrazit detailnější data</button>
            </div>
            <div className="checkbox-section">
                <div className="checkbox-column">
                    <label>
                        <Checkbox
                            shape="round"
                            variant="fill"
                            name="Physicalactivity"
                            checked={formData.Physicalactivity}
                            onChange={handleChange}
                        />
                        fyzická nečinnost
                    </label>
                    <label>
                        <Checkbox
                            shape="round"
                            variant="fill"
                            name="Alcohol"
                            checked={formData.Alcohol}
                            onChange={handleChange}
                        />
                        nadměrná konzumace alkoholu
                    </label>
                    <label>
                        <Checkbox
                            shape="round"
                            variant="fill"
                            name="Cholesterol"
                            checked={formData.Cholesterol}
                            onChange={handleChange}
                        />
                        diabetes mellitus (cukrovka)
                    </label>
                    {/* Add other checkboxes as needed */}
                </div>
                <div className="checkbox-column">
                    {/* Repeat the above structure for other columns */}
                </div>
                <div className="checkbox-column">
                    {/* Repeat the above structure for other columns */}
                </div>
            </div>
            <div className="map-section">
                <h2>MAPA RIZIKOVÝCH FAKTORŮ</h2>
                <div className="map-container">
                    {/* Your map implementation */}
                </div>
                <div className="legend">
                    <h3>Legenda</h3>
                    <p>Vybrané rizikové faktory</p>
                    <ul>
                        <li>nedostatečná konzumace ovoce a zeleniny</li>
                        <li>psychosociální faktory</li>
                        <li>kouření</li>
                        <li>Hypertenze</li>
                    </ul>
                    <div className="legend-colors">
                        <p className="color-1">Krajový průměr je větší než celostátní</p>
                        <p className="color-2">Krajový průměr je menší než celostátní</p>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default MapPage;
